import React from "react";
import "./body";

function body() {
  return (
    <div id="thread-border">
      <div id="img-container">
        <img
          src="https://www.rollingstone.com/wp-content/uploads/2018/06/rs-12335-drake-624-1377173952.jpg?w=624"
          alt=""
          id="thread-img"
        />
      </div>
      <div id="thread-container"></div>
    </div>
  );
}

export default body;
